import Home from "./Home";
import WorkoutPlans from "./"
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/workout">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
